import './App.css';
import { Route, HashRouter} from "react-router-dom"; 
import NavbarComponent from './component/NavbarComponent';
import Home from './pages/home';
import FooterComponent from './component/footerComponent';
import Final_Project from './component/final_project';

function App() {
  return (
    <HashRouter>
      <div className="App">
        <div>
          <NavbarComponent />
        </div>
        <div className="content">
          <Route exact path="/" component={Home}></Route>
          <Route path="/final_project" component={Final_Project}></Route>
        </div>
        <div>
          <FooterComponent />
        </div>
      </div>
    </HashRouter>
  );
}

export default App;
